  <div
    style={{
      backgroundColor: color,
      height: height,
      width: width,
      opacity: opacity,
      position: position,
      top: top,
      right: right
    }}
  ></div>
);

const Titre = ({ value, color, bgcolor, opacity, fontSize }) => (
  <div
    style={{
      value: value,
      color: color,
      backgroundColor: bgcolor,
      opacity: opacity,
      fontSize: fontSize
    }}
  >
    Top barber in <span style={{ color: '#A89331' }}>Charleroi</span>
  </div>
);

const Image = ({ position, width, height, top, left }) => (
  <img
    style={{
      position: position,
      width: width,
      height: height,
      top: top,
      left: left
    }}
    src={require('../../img/6.jpg')}
    alt='Homeimg'
  />
);

export class Home extends Component {
  render() {
    return (
      <div>
        <BarreDore
          color='#5A4D10'
          height='295px'
          width='32px'
          opacity='0.2'
          position='absolute'
          top='0'
        />
        <div>
          <Titre color='white' />

          <p>
            Lorem ipsum dolor sit amet, consectetur <br /> adipiscing elit, sed
            do eiusmod tempor <br /> incididunt ut labore et dolore magna <br />
            aliqua. Quam adipiscing vitae proin sagittis <br /> nisl. Pretium
            lectus quam id leo in vitae. <br /> Amet mattis vulputate enim nulla
            aliquet <br /> porttitor lacus luctus. Velit ut tortor <br />
            pretium viverra suspendisse. Lacus <br />
            vestibulum sed arcu non odio euismod. <br /> Velit ut tortor pretium
            viverra suspendisse. <br /> Lacus vestibulum sed arcu non odio{' '}
            <br />
            euismod.
          </p>

          <button>Contact Us</button>
        </div>
        <Image position='absolute' width='883px' height='639px' />

        <BarreDore
          color='#5A4D10'
          height='295px'
          width='32px'
          opacity='0.2'
          position='absolute'
          top='736px'
          right='0'
        />
      </div>
    );
  }
}

export default Home;
